import React from "react";
import ReactDOM from "react-dom/client";
import DataSet from "./DataSet";

const data = [
  { id: 1, name: 'John', age: 25 },
  { id: 2, name: 'Alice', age: 30 },
  { id: 3, name: 'Bob', age: 28 }
];

const App = () => (
  <DataSet 
    data={data}
    renderCell={(item, key) => {
      if (key === 'age') return <strong>{item[key]}</strong>;
      return item[key];
    }}
  />
);
